            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">Education&nbsp;is the process of facilitating&nbsp;learning, or the acquisition of&nbsp;knowledge,&nbsp;skills,&nbsp;values,&nbsp;beliefs, and&nbsp;habits. Educational methods include&nbsp;storytelling,&nbsp;discussion,&nbsp;teaching,&nbsp;training, and directed&nbsp;research. Education frequently takes place under the guidance of educators, but learners may also&nbsp;educate themselves.&nbsp;Education can take place in&nbsp;formal&nbsp;or&nbsp;informal&nbsp;settings and any&nbsp;experience&nbsp;that has a formative effect on the way one thinks, feels, or acts may be considered educational. The methodology of teaching is called&nbsp;pedagogy.</span></span></span></p>",
