            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">Fires start when a&nbsp;flammable&nbsp;or a combustible material, in combination with a sufficient quantity of an&nbsp;oxidizer&nbsp;such as oxygen gas or another oxygen-rich compound (though non-oxygen oxidizers exist), is exposed to a source of&nbsp;heat&nbsp;or ambient&nbsp;temperature&nbsp;above the&nbsp;flash point&nbsp;for the&nbsp;fuel/oxidizer mix, and is able to sustain a rate of rapid oxidation that produces a&nbsp;chain reaction. This is commonly called the&nbsp;fire tetrahedron. Fire cannot exist without all of these elements in place and in the right proportions. For example, a flammable liquid will start burning only if the fuel and oxygen are in the right proportions. Some fuel-oxygen mixes may require a&nbsp;catalyst, a substance that is not consumed, when added, in any&nbsp;chemical&nbsp;reaction during combustion, but which enables the reactants to combust more readily.</span></span></span></p>",
