            "text": "<p class=\"font_8\" style=\"text-align:center\"><span style=\"color:rgb(255, 255, 255); font-family:futura-lt-w01-light,sans-serif; font-size:17px\">In&nbsp;photography,&nbsp;bokeh is the aesthetic quality of the blur produced in the out-of-focus parts of an image produced by a lens.&nbsp;Bokeh has been defined as &quot;the way the lens renders out-of-focus points of light&quot;.&nbsp;Differences in&nbsp;lens aberrations&nbsp;and&nbsp;aperture&nbsp;shape cause some&nbsp;lens&nbsp;designs to blur the image in a way that is pleasing to the eye, while others produce blurring that is unpleasant or distracting&mdash;&quot;good&quot; and &quot;bad&quot; bokeh, respectively.&nbsp;Bokeh occurs for parts of the scene that lie outside the&nbsp;depth of field. Photographers sometimes deliberately use a&nbsp;shallow focus&nbsp;technique to create images with prominent out-of-focus regions.</span></p>",
