            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"color:#FFFFFF\"><span style=\"font-size:17px\">An&nbsp;infant&nbsp;(from the Latin word&nbsp;infans, meaning &quot;unable to speak&quot; or &quot;speechless&quot;) is the more formal or specialised synonym for &quot;baby&quot;, the&nbsp;very young offspring&nbsp;of a human. The term may also be used to refer to juveniles of other organisms.</span></span></span></p>\n\n<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"color:#FFFFFF\"><span style=\"font-size:17px\"><span class=\"wixGuard\">â€‹</span></span></span></span></p>\n\n<p class=\"font_8\" style=\"text-align: center;\"><span style=\"color: rgb(255, 255, 255); font-family: futura-lt-w01-light, sans-serif; font-size: 17px;\">A&nbsp;newborn&nbsp;is, in colloquial use, an infant who is only hours, days, or up to one month old. In medical contexts, newborn or&nbsp;neonate&nbsp;(from Latin, neonates, newborn) refers to an infant in the first 28 days after birth;&nbsp;the term applies to&nbsp;premature,&nbsp;full term, and post mature&nbsp;infants; before birth, the term &quot;fetus&quot; is used. The term &quot;infant&quot; is typically applied to young children between one month and one year of age; however, definitions may vary and may include children up to two years of age. When a human child learns to walk, the term &quot;toddler&quot; may be used instead</span></p>",
