            "metaData": {
              "isPreset": false,
              "schemaVersion": "1.0",
              "isHidden": false
            },
            "text": "<p class=\"font_8\" style=\"text-align:center\"><span style=\"color: rgb(255, 255, 255); font-family: futura-lt-w01-light, sans-serif; font-size: 17px;\">Abstract art&nbsp;uses a&nbsp;visual language&nbsp;of shape, form, colour&nbsp;and line to create a composition which may exist with a degree of independence from visual references in the world.&nbsp;Western art&nbsp;had been, from the&nbsp;Renaissance&nbsp;up to the middle of the 19th century, underpinned by the logic of&nbsp;perspective&nbsp;and an attempt to reproduce an illusion of visible reality. The arts of cultures other than the European had become accessible and showed alternative ways of describing visual experience to the artist. By the end of the&nbsp;19th century&nbsp;many artists felt a need to create a new kind of art which would encompass the fundamental changes taking place in technology, science and philosophy. The sources from which individual artists drew their theoretical arguments were diverse, and reflected the social and intellectual preoccupations in all areas of Western culture at that time.</span></p>",
