          "dataItem-jgsah8wx1": {
            "type": "StyledText",
            "id": "dataItem-jgsah8wx1",
            "metaData": {
              "isPreset": false,
              "schemaVersion": "1.0",
              "isHidden": false
            },
            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">Kittens develop very quickly from about two weeks of age until their seventh week. Their coordination and strength improve. They&nbsp;play-fight with their litter-mates and begin to explore the world outside the nest or den. They learn to wash themselves and others as well as play hunting and stalking games, showing their inborn ability as predators. These innate skills are developed by the kittens&#39; mother or other adult cats, who bring live prey to the nest. Later, the adult cats demonstrate hunting techniques for the kittens to emulate.&nbsp;As they reach three to four weeks old, the kittens are gradually&nbsp;weaned&nbsp;and begin to eat solid food, with weaning usually complete by six to eight weeks.&nbsp;Kittens generally begin to lose their&nbsp;baby teeth&nbsp;around three months of age, and have a complete set of adult teeth by nine months.&nbsp;Kittens live primarily on solid food after weaning, but usually continue to suckle from time to time until separated from their mothers. Some mother cats will scatter their kittens as early as three months of age, while others continue to look after them until they approach&nbsp;sexual maturity.</span></span></span></p>",
            "stylesMapId": "CK_EDITOR_PARAGRAPH_STYLES",
            "linkList": []
          },
