            "text": "<p class=\"font_8\" style=\"font-size: 18px; text-align: center;\"><span style=\"font-size:18px;\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\">A&nbsp;car&nbsp;(or&nbsp;automobile) is a wheeled&nbsp;motor vehicle&nbsp;used for&nbsp;transportation. Most definitions of&nbsp;car&nbsp;say they run primarily on roads, seat one to eight people, have four&nbsp;tires, and mainly transport people rather than goods.&nbsp;Cars came into global use during the 20th century, and&nbsp;developed economies&nbsp;depend on them. The year 1886 is regarded as the birth year of the modern car when German inventor&nbsp;Karl Benz&nbsp;built his&nbsp;Benz Patent-Motorwagen. Cars became widely available in the early 20th century. One of the first cars that were accessible to the masses was the 1908&nbsp;Model T, an American car manufactured by the&nbsp;Ford Motor Company. Cars were rapidly adopted in the US, where they replaced&nbsp;animal-drawn&nbsp;carriages&nbsp;and carts, but took much longer to be accepted in Western Europe and other parts of the world.</span></span></span></p>",
