            "text": "<p class=\"font_7\" style=\"text-align:center\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"color:#FFFFFF\">The time of sunset varies throughout the year, and is determined by the viewer&#39;s position on Earth, specified by longitude and latitude, and elevation. Small daily changes and noticeable semi-annual changes in the timing of sunsets are driven by the axial tilt of Earth, daily rotation of the Earth, the planet&#39;s movement in its annual elliptical orbit around the Sun, and the Earth and Moon&#39;s paired revolutions around each other. During winter and spring, the days get longer and sunsets occur later every day until the day of the latest sunset, which occurs after the summer solstice. In the&nbsp;Northern Hemisphere, the latest sunset occurs late in June or in early July, but not on the summer solstice of June 21. This date depends on the viewer&#39;s latitude (connected with the Earth&#39;s slower movement around the&nbsp;aphelion&nbsp;around July 4). Likewise, the earliest sunset does not occur on the winter solstice, but rather about two weeks earlier, again depending on the viewer&#39;s latitude. In the Northern Hemisphere, it occurs in early December or late November (influenced by the Earth&#39;s faster movement near its&nbsp;perihelion, which occurs around January 3).</span></span></p>",
