            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">The modern era of lighthouses began at the turn of the 18th century, as lighthouse construction boomed in lockstep with burgeoning levels of&nbsp;transatlantic&nbsp;commerce. Advances in structural engineering and new and efficient lighting equipment allowed for the creation of larger and more powerful lighthouses, including ones exposed to the sea. The function of lighthouses shifted toward the provision of a visible warning against shipping hazards, such as rocks or reefs.</span></span></span></p>",
