            "text": "<p class=\"font_7\" style=\"text-align:center\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"color:#FFFFFF\">From an astronomical view, the&nbsp;equinoxes&nbsp;and solstices would be the middle of the respective seasons,&nbsp;but sometimes astronomical summer is defined as starting at the solstice, the time of maximal&nbsp;insolation, or on the traditional date of June 21. A variable&nbsp;seasonal lag&nbsp;means that the&nbsp;meteorological&nbsp;center of the season, which is based on average temperature patterns, occurs several weeks after the time of maximal insolation.[3]&nbsp;The meteorological convention is to define summer as comprising the months of June, July, and August in the northern hemisphere and the months of December, January, and February in the southern hemisphere.&nbsp;Under meteorological definitions, all seasons are arbitrarily set to start at the beginning of a calendar month and end at the end of a month.&nbsp;This meteorological definition of summer also aligns with the commonly viewed notion of summer as the season with the longest (and warmest) days of the year, in which daylight predominates. The meteorological reckoning of seasons is used in&nbsp;Australia,&nbsp;Austria,&nbsp;Denmark, the former&nbsp;Soviet Union&nbsp;and&nbsp;Japan. It is also used by many in the&nbsp;United Kingdom. In&nbsp;Ireland, the summer months according to the national meteorological service,&nbsp;Met &Eacute;ireann, are June, July and August. However, according to the&nbsp;Irish Calendar, summer begins on 1 May and ends on 1 August. School textbooks in Ireland follow the cultural norm of summer commencing on 1 May rather than the meteorological definition of 1 June.</span></span></p>",
            "stylesMapId": "CK_EDITOR_PARAGRAPH_STYLES",
            "linkList": []
