            "text": "<h1 class=\"font_0\" style=\"text-align: center;\"><span style=\"color: rgb(255, 255, 255); font-family: futura-lt-w01-light, sans-serif; font-size: 40px;\">Cossyimages Restaurant&nbsp;Collection</span></h1>",
