            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">Restaurants range from inexpensive and informal&nbsp;lunching&nbsp;or&nbsp;dining&nbsp;places catering to people working nearby, with modest food served in simple settings at low prices, to expensive establishments serving refined food and&nbsp;fine wines&nbsp;in a formal setting. In the former case, customers usually wear casual clothing. In the latter case, depending on culture and local traditions, customers might wear&nbsp;semi-casual,&nbsp;semi-formal&nbsp;or&nbsp;formal wear. Typically, at mid- to high-priced restaurants, customers sit at tables, their orders are taken by a&nbsp;waiter, who brings the food when it is ready. After eating, the customers then pay the bill. In some restaurants, such as workplace&nbsp;cafeterias, there are no waiters; the customers use trays, on which they place cold items that they select from a refrigerated container and hot items which they request from cooks, and then they pay a cashier before they sit down. Another restaurant approach which uses few waiters is the buffet restaurant. Customers serve food onto their own plates and then pay at the end of the meal. Buffet restaurants typically still have waiters to serve drinks and alcoholic beverages. Fast food restaurants are also considered a restaurant.</span></span></span></p>",
