            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">Born after an average of 63 days of&nbsp;gestation, puppies emerge in an&nbsp;amnion&nbsp;that is bitten off and eaten by the mother dog.&nbsp;Puppies begin to&nbsp;nurse&nbsp;almost immediately. If the&nbsp;litter&nbsp;exceeds six puppies, particularly if one or more are obvious&nbsp;runts, human intervention in hand-feeding the stronger puppies is necessary to ensure that the runts get proper nourishment and attention from the mother. As they reach one month of age, puppies are gradually&nbsp;weaned&nbsp;and begin to eat solid food. The mother may regurgitate partially digested food for the puppies or might let them eat some of her solid food.&nbsp;The mother dog usually refuses to nurse at this stage, though she might let them occasionally nurse for comfort.</span></span></span></p>",
