            "text": "<p class=\"font_7\" style=\"text-align:center\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"color:#FFFFFF\">A&nbsp;woman&nbsp;is a&nbsp;female&nbsp;human&nbsp;being. The term&nbsp;woman&nbsp;is usually reserved for an&nbsp;adult, with the term&nbsp;girl&nbsp;being the usual term for a female&nbsp;child&nbsp;or&nbsp;adolescent. The term&nbsp;woman&nbsp;is also sometimes used to identify a female human, regardless of age, as in phrases such as &quot;women&#39;s rights&quot;. Women with typical genetic development are usually capable of giving&nbsp;birth&nbsp;from&nbsp;puberty&nbsp;until&nbsp;menopause. With regard to&nbsp;gender, a woman may also be a person whose&nbsp;sex assignment&nbsp;does not align with their&nbsp;gender identity,&nbsp;or those who have&nbsp;sexual characteristics&nbsp;that do not fit typical notions of male or female (intersex).</span></span></p>",
