            "text": "<p class=\"font_7\" style=\"text-align:center\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"color:#FFFFFF\">The&nbsp;workforce&nbsp;or&nbsp;labour force&nbsp;(labor force&nbsp;in&nbsp;American English;&nbsp;see spelling differences) is the&nbsp;labour&nbsp;pool&nbsp;in&nbsp;employment. It is generally used to describe those working for a single&nbsp;company&nbsp;or&nbsp;industry, but can also apply to a geographic region like a city, state, or country. Within a company, its value can be labelled as its &quot;Workforce in Place&quot;. The workforce of a country includes both the employed and the unemployed. The&nbsp;labour force participation rate,&nbsp;LFPR&nbsp;(or&nbsp;economic activity rate,&nbsp;EAR), is the ratio between the labour force and the overall size of their&nbsp;cohort&nbsp;(national population of the same age range). The term generally excludes the&nbsp;employers&nbsp;or&nbsp;management, and can imply those involved in&nbsp;manual labour. It may also mean all those who are available for work.</span></span></p>",
