            "text": "<p class=\"font_8\" style=\"text-align:center\"><span style=\"color:rgb(255, 255, 255); font-family:futura-lt-w01-light,sans-serif; font-size:17px\">A&nbsp;hamburger,&nbsp;beefburger&nbsp;or&nbsp;burger&nbsp;is a&nbsp;sandwich&nbsp;consisting of one or more cooked&nbsp;patties&nbsp;of&nbsp;ground meat, usually&nbsp;beef, placed inside a sliced&nbsp;bread roll&nbsp;or&nbsp;bun. The patty may be&nbsp;pan fried,&nbsp;barbecued, or&nbsp;flame broiled. Hamburgers are often served with&nbsp;cheese,&nbsp;lettuce,&nbsp;tomato,&nbsp;bacon,&nbsp;onion,&nbsp;pickles, or&nbsp;chiles;&nbsp;condiments&nbsp;such as&nbsp;mustard,&nbsp;mayonnaise,&nbsp;ketchup,&nbsp;relish, or &quot;special sauce&quot;; and are frequently placed on&nbsp;sesame seed buns. A hamburger topped with cheese is called a&nbsp;cheeseburger.</span></p>",
