            "text": "<p class=\"font_7\" style=\"text-align:center\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"color:#FFFFFF\">Three quarters of the planet&nbsp;Earth&nbsp;is covered by water. A majority of the planet&#39;s solid surface is&nbsp;abyssal plain, at depths between 4,000 and 5,500 metres (13,100 and 18,000&nbsp;ft) below the surface of the oceans. The solid surface location on the planet closest to the centre of the orb is the&nbsp;Challenger Deep, located in the&nbsp;Mariana Trench&nbsp;at a depth of 10,924 metres (35,840&nbsp;ft). Although a number of&nbsp;human&nbsp;activities are conducted underwater&mdash;such as research,&nbsp;scuba diving&nbsp;for&nbsp;work&nbsp;or&nbsp;recreation, or even&nbsp;underwater warfare&nbsp;with&nbsp;submarines, this very extensive environment on planet&nbsp;Earth&nbsp;is hostile to humans in many ways and therefore little explored. But it can be explored by&nbsp;sonar, or more directly via manned or autonomous&nbsp;submersibles. The ocean floors have been surveyed via sonar to at least a coarse resolution; particularly-strategic areas have been mapped in detail, in the name of detecting enemy submarines, or aiding friendly ones, though the resulting maps may still be classified.</span></span></p>",
