            "text": "<h1 class=\"font_0\" style=\"font-size:40px; text-align:center\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:40px\"><span style=\"color:#FFFFFF\">PNG images: Flowers Collection</span></span></span></h1>",
