            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">A&nbsp;flower, sometimes known as a&nbsp;bloom&nbsp;or&nbsp;blossom, is the&nbsp;reproductive&nbsp;structure found in&nbsp;flowering plants&nbsp;(plants of the division&nbsp;Magnoliophyta, also called angiosperms). The biological function of a flower is to effect reproduction, usually by providing a mechanism for the union of sperm with eggs. Flowers may facilitate outcrossing (fusion of sperm and eggs from different individuals in a population) or allow selfing (fusion of sperm and egg from the same flower). Some flowers produce&nbsp;diaspores&nbsp;without fertilization (parthenocarpy). Flowers contain&nbsp;sporangia&nbsp;and are the site where&nbsp;gametophytes&nbsp;develop. Many flowers have evolved to be attractive to animals, so as to cause them to be vectors for the transfer of&nbsp;pollen. After fertilization, the&nbsp;ovary&nbsp;of the flower develops intofruit&nbsp;containing&nbsp;seeds.</span></span></span></p>\n\n<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\"><span class=\"wixGuard\">â€‹</span></span></span></span></p>\n\n<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">(Page 1)</span></span></span></p>",
