            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">In everyday usage,&nbsp;vegetables&nbsp;are certain parts of plants that are consumed by humans as food as part of a savory meal. Originally, the traditional term (still commonly used in biology) included the flowers, fruit, stems, leaves, roots, tubers, bark, seeds, and all other plant matter, although modern-day culinary usage of the term&nbsp;vegetable&nbsp;may exclude food derived from plants such as&nbsp;fruits,&nbsp;nuts, and&nbsp;cereal&nbsp;grains, but include seeds such as&nbsp;pulses; the term&nbsp;vegetable&nbsp;is somewhat arbitrary, and can be largely defined through culinary and cultural tradition.</span></span></span></p>",
