            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">Clip art&nbsp;(also&nbsp;clipart,&nbsp;clip-art), in the&nbsp;graphic arts, is pre-made images used to illustrate any medium. Today, clip art is used extensively. Clip art comes in many forms, both electronic and printed. However, most clip art today is created, distributed, and used in an electronic form. Since its inception, clip art has evolved to include a wide variety of content, file formats, illustration styles, and licensing restrictions. Clip art is generally composed exclusively of illustrations (created by hand or by&nbsp;computersoftware), and does not include&nbsp;stock photography.</span></span></span></p>",
            "stylesMapId": "CK_EDITOR_PARAGRAPH_STYLES",
