            "metaData": {
              "isPreset": false,
              "schemaVersion": "1.0",
              "isHidden": false
            },
            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">Music&nbsp;is an art form and&nbsp;cultural&nbsp;activity whose medium is sound organized in time. The common elements of music are&nbsp;pitch&nbsp;(which governs&nbsp;melody&nbsp;and&nbsp;harmony), rhythm (and its associated concepts&nbsp;tempo,&nbsp;meter, and&nbsp;articulation),&nbsp;dynamics&nbsp;(loudness and softness), and the sonic qualities of&nbsp;timbre&nbsp;and&nbsp;texture&nbsp;(which are sometimes termed the &quot;color&quot; of a musical sound). Different&nbsp;styles or types&nbsp;of music may emphasize, de-emphasize or omit some of these elements. Music is performed with a vast range of&nbsp;instruments&nbsp;and vocal techniques ranging from singing to&nbsp;rapping; there are solely&nbsp;instrumental pieces,&nbsp;solely vocal pieces&nbsp;(such as songs without instrumental&nbsp;accompaniment) and pieces that combine singing and instruments. The word derives from&nbsp;Greek&nbsp;&mu;&omicron;&upsilon;&sigma;&iota;&kappa;Î®&nbsp;(mousike; &quot;art of the&nbsp;Muses&quot;).&nbsp;See&nbsp;glossary of musical terminology.</span></span></span></p>",
