            "id": "dataItem-jh26a6ud",
            "metaData": {
              "isPreset": false,
              "schemaVersion": "1.0",
              "isHidden": false
            },
            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">Different religions may or may not contain various elements ranging from the&nbsp;divine,&nbsp;sacred things,&nbsp;faith,&nbsp;a supernatural being or supernatural beings[6]&nbsp;or &quot;some sort of ultimacy and transcendence that will provide norms and power for the rest of life&quot;.&nbsp;Religious practices may include&nbsp;rituals,&nbsp;sermons, commemoration or veneration (of&nbsp;deities),&nbsp;sacrifices,&nbsp;festivals,&nbsp;feasts,&nbsp;trances,&nbsp;initiations,&nbsp;funerary services,&nbsp;matrimonial services,&nbsp;meditation,&nbsp;prayer,&nbsp;music,&nbsp;art,&nbsp;dance,&nbsp;public service, or other aspects of human&nbsp;culture. Religions have&nbsp;sacred histories&nbsp;and&nbsp;narratives, which may be preserved in sacred scriptures, and&nbsp;symbols&nbsp;and&nbsp;holy places, that aim mostly to give a&nbsp;meaning to life. Religions may contain symbolic stories, which are sometimes said by followers to be true, that have the side purpose of explaining the&nbsp;origin of life, the&nbsp;universe, and other things. Traditionally, faith, in addition to reason, has been considered a source of&nbsp;religious beliefs.</span></span></span></p>\n\n<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\"><span style=\"text-decoration:underline\"><span class=\"wixGuard\">â€‹</span></span></span></span></span></p>\n\n<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">(Page 2)</span></span></span></p>",
