            "metaData": {
              "isPreset": false,
              "schemaVersion": "1.0",
              "isHidden": false
            },
            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">A&nbsp;monument&nbsp;is a type of&mdash;usually three-dimensional&mdash;structure&nbsp;that was explicitly created to commemorate a person or event, or which has become relevant to a social group as a part of their remembrance of historic times or cultural heritage, due to its artistic, historical, political, technical or architectural importance. Examples of monuments include statues, (war) memorials, historical buildings, archeological sites, and cultural assets. If there is a public interest in its preservation, a monument can for example be listed as a UNESCO World Heritage Site.</span></span></span></p>",
            "stylesMapId": "CK_EDITOR_PARAGRAPH_STYLES",
