            "text": "<p class=\"font_7\" style=\"text-align:center\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"color:#FFFFFF\">In&nbsp;botany, a&nbsp;tree&nbsp;is a&nbsp;perennial&nbsp;plant with an elongated stem, or&nbsp;trunk, supporting branches and leaves in most species. In some usages, the definition of a tree may be narrower, including only woody plants with&nbsp;secondary growth, plants that are usable as&nbsp;lumber&nbsp;or plants above a specified height. Trees are not a&nbsp;taxonomic group&nbsp;but include a variety of plant species that have independently evolved a woody trunk and branches as a way to tower above other plants to compete for sunlight. Trees tend to be long-lived, some reaching several thousand years old. In looser definitions, the taller&nbsp;palms,&nbsp;tree ferns,&nbsp;bananas&nbsp;and&nbsp;bamboos&nbsp;are also trees. Trees have been in existence for 370 million years. It is estimated that there are just over 3 trillion mature trees in the world.</span></span></p>",
