            "text": "<p class=\"font_7\" style=\"text-align:center\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"color:#FFFFFF\">Winter&nbsp;is the&nbsp;coldest&nbsp;season&nbsp;of the year in&nbsp;polar&nbsp;and&nbsp;temperate zones&nbsp;(winter does not occur in the&nbsp;tropical zone). It occurs after&nbsp;autumn&nbsp;and before&nbsp;spring&nbsp;in each year. Winter is caused by the axis of the Earth in that&nbsp;hemisphere&nbsp;being oriented away from the&nbsp;Sun. Different cultures define different dates as the start of winter, and some use a definition based on weather. When it is winter in the&nbsp;Northern Hemisphere, it is&nbsp;summer&nbsp;in the&nbsp;Southern Hemisphere, and vice versa. In many regions, winter is associated with&nbsp;snow&nbsp;and&nbsp;freezing&nbsp;temperatures. The moment of&nbsp;winter solstice&nbsp;is when the sun&#39;s elevation with respect to the North or South Pole is at its most negative value (that is, the sun is at its farthest below the horizon as measured from the pole). The day on which this occurs has the shortest day and the longest night, with a daylength increasing and nightlength decreasing as the season processes after the solstice. The earliest sunset and latest sunrise dates outside the polar regions differ from the date of the winter solstice, however, and these depend on latitude, due to the variation in the solar day throughout the year caused by the Earth&#39;s elliptical orbit (see&nbsp;earliest and latest sunrise and sunset).</span></span></p>",
            "stylesMapId": "CK_EDITOR_PARAGRAPH_STYLES",
            "linkList": []
