            "id": "dataItem-jgvxh0je",
            "metaData": {
              "isPreset": false,
              "schemaVersion": "1.0",
              "isHidden": false
            },
            "text": "<p class=\"font_8\" style=\"text-align:center\"><span style=\"color:rgb(255, 255, 255); font-family:futura-lt-w01-light,sans-serif; font-size:17px\">Animals&nbsp;are&nbsp;multicellular&nbsp;eukaryotic&nbsp;organisms that form the&nbsp;biological kingdom&nbsp;Animalia. With few exceptions, animals&nbsp;consume organic material,&nbsp;breathe oxygen, are&nbsp;able to move,&nbsp;reproduce sexually, and grow from a hollow sphere of cells, the&nbsp;blastula, during&nbsp;embryonic development. Over 1.5 million&nbsp;living&nbsp;animalspecies&nbsp;have been&nbsp;described&mdash;of which around 1 million are&nbsp;insects&mdash;but it has been estimated there are over 7 million animals in total. Animals range in length from 8.5&nbsp;millionths of a metre to 33.6 metres (110&nbsp;ft) and have&nbsp;complex interactions&nbsp;with each other and their environments, forming intricate&nbsp;food webs. The study of animals is called&nbsp;zoology.</span></p>\n\n<p class=\"font_8\" style=\"text-align:center\"><span style=\"color:rgb(255, 255, 255); font-family:futura-lt-w01-light,sans-serif; font-size:17px\"><span class=\"wixGuard\">â€‹</span></span></p>\n\n<p class=\"font_8\" style=\"text-align:center\"><span style=\"color:rgb(255, 255, 255); font-family:futura-lt-w01-light,sans-serif; font-size:17px\">(Page 1)</span></p>",
