          "dataItem-jgsah1ud1": {
            "type": "StyledText",
            "id": "dataItem-jgsah1ud1",
            "metaData": {
              "isPreset": false,
              "schemaVersion": "1.0",
              "isHidden": false
            },
            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">A&nbsp;house&nbsp;is a&nbsp;building&nbsp;that functions as a&nbsp;home. They can range from simple&nbsp;dwellings&nbsp;such as rudimentary&nbsp;huts&nbsp;of&nbsp;nomadic tribes&nbsp;and the improvised&nbsp;shacks&nbsp;in&nbsp;shantytowns&nbsp;to complex, fixed structures of wood, brick, concrete or other materials containing plumbing, ventilation, and electrical systems.&nbsp;Houses use a range of different&nbsp;roofing&nbsp;systems to keep precipitation such as rain from getting into the dwelling space. Houses may have&nbsp;doors&nbsp;or&nbsp;locks&nbsp;to secure the dwelling space and protect its inhabitants and contents from burglars or other trespassers. Most conventional modern houses in Western cultures will contain one or more&nbsp;bedrooms&nbsp;and&nbsp;bathrooms, a&nbsp;kitchen&nbsp;or cooking area, and a&nbsp;living room. A house may have a separate&nbsp;dining room, or the eating area may be integrated into another room. Some large houses in North America have a&nbsp;recreation room. In traditional agriculture-oriented societies,&nbsp;domestic animals&nbsp;such as chickens or larger livestock (like cattle) may share part of the house with humans. The social unit that lives in a house is known as a&nbsp;household.</span></span></span></p>",
            "stylesMapId": "CK_EDITOR_PARAGRAPH_STYLES",
            "linkList": []
          },
