            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">A&nbsp;concert&nbsp;is a live&nbsp;music&nbsp;performance&nbsp;in front of an&nbsp;audience. The performance may be by a single musician, sometimes then called a&nbsp;recital, or by a&nbsp;musical ensemble, such as an&nbsp;orchestra,&nbsp;choir, or&nbsp;band. Concerts are held in a wide variety and size of settings, from private&nbsp;houses&nbsp;and small&nbsp;nightclubs, dedicated&nbsp;concert halls,&nbsp;arenas&nbsp;and&nbsp;parks&nbsp;to large multipurpose buildings, and even sports&nbsp;stadiums. Indoor concerts held in the largest&nbsp;venues&nbsp;are sometimes called&nbsp;arena concerts&nbsp;or&nbsp;amphitheatre&nbsp;concerts. Informal names for a concert include&nbsp;show&nbsp;and&nbsp;gig.</span></span></span></p>",
