            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">Smoke&nbsp;is a collection of airborne&nbsp;solid&nbsp;and&nbsp;liquid&nbsp;particulates&nbsp;and&nbsp;gases&nbsp;emitted when a material undergoes&nbsp;combustion&nbsp;or&nbsp;pyrolysis, together with the quantity of air that is&nbsp;entrained&nbsp;or otherwise mixed into the mass. It is commonly an unwanted&nbsp;by-product&nbsp;of fires (including&nbsp;stoves,&nbsp;candles,&nbsp;oil lamps, and&nbsp;fireplaces), but may also be used for&nbsp;pest control&nbsp;(fumigation), communication (smoke signals), defensive and offensive capabilities in the military (smoke screen),&nbsp;cooking, or&nbsp;smoking&nbsp;(tobacco,&nbsp;cannabis, etc.). Smoke is used in rituals where incense, sage, or resin is burned to produce a smell for spiritual purposes. Smoke is sometimes used as a flavoring agent, and preservative for various foodstuffs. Smoke is also a component of&nbsp;internal combustion engine&nbsp;exhaust gas, particularly&nbsp;diesel exhaust.</span></span></span></p>",
