            "text": "<p class=\"font_8\" style=\"font-size:17px; line-height:1.6em; text-align:center\"><span style=\"font-size:17px\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\">Please note that the file size for the complete FreePNGs&nbsp;collection is 38GB so download can take a couple of hours.</span></span></span></p>\n\n<p class=\"font_8\" style=\"font-size:17px; line-height:1.6em; text-align:center\"><span style=\"font-size:17px\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span class=\"wixGuard\">â€‹</span></span></span></span></p>\n\n<p class=\"font_8\" style=\"font-size:17px; line-height:1.6em; text-align:center\"><span style=\"font-size:17px\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\">After payment you will be directed to our Dropbox&nbsp;containing the complete FreePNGs collection.</span></span></span></p>\n\n<p class=\"font_8\" style=\"line-height:1.6em; text-align:center\"><span style=\"color:rgb(255, 255, 255); font-family:futura-lt-w01-light,sans-serif; font-size:17px\">Click &#39;RETURN TO MERCHANT&#39;</span></p>\n\n<p class=\"font_8\" style=\"font-size:17px; line-height:1.6em; text-align:center\"><span style=\"font-size:17px\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span class=\"wixGuard\">â€‹</span></span></span></span></p>\n\n<p class=\"font_8\" style=\"line-height:1.6em; text-align:center\"><span style=\"color:rgb(255, 255, 255); font-family:futura-lt-w01-light,sans-serif; font-size:17px\">You will see all categories&nbsp;as seen on FreePNGs.</span></p>\n\n<p class=\"font_8\" style=\"line-height:1.6em; text-align:center\"><span style=\"color:rgb(255, 255, 255); font-family:futura-lt-w01-light,sans-serif; font-size:17px\"><span class=\"wixGuard\">â€‹</span></span></p>\n\n<p class=\"font_8\" style=\"line-height:1.6em; text-align:center\"><span style=\"color:rgb(255, 255, 255); font-family:futura-lt-w01-light,sans-serif; font-size:17px\">Simply click the first category&nbsp;(or your desired category) then hit the download icon in the top right corner.</span></p>\n\n<p class=\"font_8\" style=\"line-height:1.6em; text-align:center\"><span style=\"color:rgb(255, 255, 255); font-family:futura-lt-w01-light,sans-serif; font-size:17px\"><span class=\"wixGuard\">â€‹</span></span></p>\n\n<p class=\"font_8\" style=\"line-height:1.6em; text-align:center\"><span style=\"color:rgb(255, 255, 255); font-family:futura-lt-w01-light,sans-serif; font-size:17px\">You can download directly to your desktop or Dropbox.</span></p>\n\n<p class=\"font_8\" style=\"line-height:1.6em; text-align:center\"><span style=\"color:rgb(255, 255, 255); font-family:futura-lt-w01-light,sans-serif; font-size:17px\"><span class=\"wixGuard\">â€‹</span></span></p>\n\n<p class=\"font_8\" style=\"line-height:1.6em; text-align:center\"><span style=\"color:rgb(255, 255, 255); font-family:futura-lt-w01-light,sans-serif; font-size:17px\">**Due to the nature of the sale, refunds are not available however, if you have any difficulties&nbsp;with your purchase please don&#39;t hesitate&nbsp;to get in touch**</span></p>\n\n<p class=\"font_8\" style=\"line-height:1.6em; text-align:center\"><span style=\"color:rgb(255, 255, 255); font-family:futura-lt-w01-light,sans-serif; font-size:17px\"><span class=\"wixGuard\">â€‹</span></span></p>\n\n<p class=\"font_8\" style=\"font-size:25px; line-height:1.6em; text-align:center\"><span style=\"font-size:25px\"><span style=\"font-weight:bold\"><span style=\"color:rgb(255, 255, 255); font-family:futura-lt-w01-light,sans-serif\">$9.99</span></span></span><span style=\"color: rgb(255, 255, 255); font-family: futura-lt-w01-light, sans-serif; font-size: 17px;\">â€‹</span></p>",
