            "text": "<p class=\"font_8\" style=\"font-size: 17px; text-align: center;\"><span style=\"color:#FFFFFF;\"><span style=\"font-family:futura-lt-w01-light,sans-serif;\"><span style=\"font-size:17px;\">Black and white, often abbreviated&nbsp;B/W&nbsp;or&nbsp;B&amp;W, and hyphenated&nbsp;black-and-white&nbsp;when used as an adjective, is any of several&nbsp;monochrome&nbsp;forms in&nbsp;visual arts.</span></span></span></p>\n\n<p class=\"font_8\" style=\"font-size: 17px; text-align: center;\"><span style=\"color:#FFFFFF;\"><span style=\"font-family:futura-lt-w01-light,sans-serif;\"><span style=\"font-size:17px;\"><span class=\"wixGuard\">â€‹</span></span></span></span></p>\n\n<p class=\"font_8\" style=\"font-size: 17px; text-align: center;\"><span style=\"color:#FFFFFF;\"><span style=\"font-family:futura-lt-w01-light,sans-serif;\"><span style=\"font-size:17px;\">Black-and-white images are not usually starkly contrasted black and white. They combine black and white in a continuum producing a range of&nbsp;shades of gray. Further, many monochrome prints in still photography, especially those produced earlier in its development, were in&nbsp;sepia&nbsp;(mainly for archival stability), which yielded richer, subtler&nbsp;shading&nbsp;than reproductions in plain black-and-white.</span></span></span></p>",
