            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">Before the 18th century, many marriages were not arranged, but rather developed out of more or less spontaneous relationships. After the 18th century, illicit relationships took on a more independent role. In bourgeois marriage, illicitness may have become more formidable and likely to cause tension.&nbsp;In&nbsp;Ladies of the Leisure Class,&nbsp;Rutgers University&nbsp;professor Bonnie G. Smith depicts courtship and marriage rituals that may be viewed as oppressive to modern people. She writes &quot;When the young women of the Nord married, they did so without illusions of love and romance. They acted within a framework of concern for the reproduction of bloodlines according to financial, professional, and sometimes political interests.&quot; Subsequent&nbsp;sexual revolution&nbsp;has lessened the conflicts arising out of liberalism, but not eliminated them.</span></span></span></p>",
