            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">Electronics&nbsp;is the discipline dealing with the development and application of devices and systems involving the flow of electrons in a vacuum, in gaseous media, and in semiconductors. Electronics deals with&nbsp;electrical circuits&nbsp;that involve&nbsp;active electrical components&nbsp;such as&nbsp;vacuum tubes,&nbsp;transistors,&nbsp;diodes,&nbsp;integrated circuits,optoelectronics, and&nbsp;sensors, associated&nbsp;passive electrical components, and interconnection technologies. Commonly, electronic devices contain circuitry consisting primarily or exclusively of active&nbsp;semiconductors&nbsp;supplemented with passive elements; such a circuit is described as an&nbsp;electronic circuit.</span></span></span></p>",
