            "text": "<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">Fruits are the means by which angiosperms disseminate&nbsp;seeds. Edible fruits, in particular, have propagated with the movements of humans and animals in a&nbsp;symbiotic relationship&nbsp;as a means for&nbsp;seed dispersal&nbsp;and&nbsp;nutrition; in fact, humans and many animals have become dependent on fruits as a source of food.&nbsp;Accordingly, fruits account for a substantial fraction of the world&#39;s&nbsp;agricultural&nbsp;output, and some (such as the&nbsp;apple&nbsp;and the&nbsp;pomegranate) have acquired extensive cultural and symbolic meanings.</span></span></span></p>\n\n<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\"><span class=\"wixGuard\">â€‹</span></span></span></span></p>\n\n<p class=\"font_8\" style=\"font-size:17px; text-align:center\"><span style=\"color:#FFFFFF\"><span style=\"font-family:futura-lt-w01-light,sans-serif\"><span style=\"font-size:17px\">(Page 2)</span></span></span></p>",
